            WriteLiteral(@"<div class=""entry-content"">
    <div class=""header-content"">
        <h1>Ngôn ngữ nhật</h1>
    </div>
    <p><strong>Tổng quan về ngành</strong></p>
    <p style=""text-align: justify;"">
        Các công ty Nhật Bản đang đẩy mạnh đầu tư vào Việt Nam, mở ra những
        cơ hội việc làm phong phú với mức đãi ngộ tốt, thu nhập cao dành cho người thành thạo tiếng
        Nhật. Trước nhu cầu đó, Trường Đại học FPT mở ngành <a href=""https://daihoc.fpt.edu.vn/co-hoi-viec-lam-nganh-ngon-ngu-nhat-trong-thoi-ky-4-0/"">
            Ngôn
            ngữ Nhật
        </a>.&nbsp;Chương trình đào tạo Ngôn ngữ Nhật của Trường đại học FPT là sự kết hợp
        của năm khối kiến thức: kiến thức chuyên môn, kiến thức xã hội, kỹ năng mềm, ngoại ngữ và định
        hướng công nghiệp nhằm giúp sinh viên tốt nghiệp có đủ kiến thức, kỹ năng chuyên môn, năng lực
        ngoại ngữ và kỹ năng mềm để kinh doanh với các đối tác nước ngoài.
    </p>
    <p style=""text-align: justify;"">
        Chương trình học được thiết ");
            WriteLiteral(@"kế linh động (dưới sự cố vấn của Giáo sư
        Satoshi Miyazaki – Trường sau đại học về ứng dụng ngôn ngữ Nhật Đại học Waseda, Nhật Bản, đồng
        thời là Giám đốc dự án trường Đại học Việt Nhật ) cho phép sinh viên lựa chọn hướng ngành theo
        khả năng và sở thích với hai chuyên ngành đang “hot” hiện nay là tiếng Nhật thương mại và tiếng
        Nhật Công nghệ thông tin… Đặc biệt, sinh viên có cơ hội đi học 1 học kỳ tại Nhật Bản trong giai
        đoạn OJT.
    </p>
    <p>
