        hóa Nhật Bản, có kiến thức cơ bản về ngôn ngữ và khả năng ứng dụng tiếng Nhật Bản thành thạo để
        làm việc tại các cơ quan ban ngành của chính phủ, các tổ chức, doanh nghiệp trong và ngoài nước;
