    <p style=""text-align: justify;""><strong>Triển vọng nghề nghiệp:</strong></p>
    <p>Cử nhân ngành Ngôn ngữ Nhật có thể đảm nhiệm một số công việc sau:</p>
    <ul>
        <li>
