                <td style=""width: 12.812953973709387%; height: 368px;"">Học kỳ 7</td>
                <td style=""width: 34.405980937533215%; height: 368px;"" data-title=""học phần"">
                    <ul>
                        <li>Dẫn luận ngôn ngữ (Tiếng Việt)</li>
