                </td>
                <td style=""width: 51.59763313609468%; height: 368px;"" data-title=""kỹ năng đạt được"">
                    <ul>
                        <li>
                            Sinh viên được cung cấp kiến thức về mối quan hệ giữa ngôn ngữ và văn hóa,
                            giữa ngôn ngữ và tư duy. Sinh viên có kiến thức về ngữ âm, ngữ pháp, từ
                            vựng, ngữ nghĩa, ngữ dụng để hiểu một ngôn ngữ khác.
                        </li>
                        <li>
