                            chuyên ngành. Sinh viên sẽ chủ động trong việc tìm hiểu và tiếp thu kiến
                            thức, phát huy tinh thần tích cực trong hoạt động nhóm.
                        </li>
                        <li>
                            Sinh viên có khả năng viết một báo cáo kết thúc môn học, luận văn tốt
